import React from 'react';
import Button from '@mui/material/Button';
import  Field  from './Field';
import  Box  from '@mui/material/Box';
import {Link} from '@mui/material';
import { Typography } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { click } from '@testing-library/user-event/dist/click';
import  Econ from './Econ.jpg';
export default  class Forms extends React.Component{
    constructor(props){
      super(props)
    }
    Handleclick=(event)=>{
      console.log("forye")
      event.preventDefault()

    }
    render()
    {
      return(

        <Box
        sx={{
            margin:'auto',
            width:'50ch',
            height:'55ch',
            marginTop: 15,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent:'center',
            borderRadius:5,
            boxShadow:5,
          }}
        >
          <Image/>
          <Typography component="h1" variant="h2">
           E-delivery
           </Typography>
          <Typography component="h1" variant="h5"
           sx={{
            margin:inherit
          }}
          >
            Log into your account
          </Typography>
          <Box
          component="form" sx={{
            '& .MuiTextField-root': { m: 1, width: '40ch' }
          }}
          onSubmit={this.Handleclick}
          noValidate
          autoComplete="off"
          >
              <Field name='username' label='Username' type='text'/>
              <Field name='passsword' label='Password' type='password'/>
              <Link href="#" variant="body2">
                  {"Forgot password"}
                </Link>
              <ButtonUsage click={this.Handleclick}/>
              <Link href="#" variant="body2">
                  {"Don't have an account? Sign Up"}
                </Link>
          </Box>
        </Box>
      )
    }
  }

  class ButtonUsage extends React.Component{
    constructor(props){
      super(props)
    }

    render()
    {
      return(
        <div>
          <Button variant="contained" color='primary' fullWidth type='submit'>Login</Button>
        </div> 
      )
    }
  }

  function Image(){
    return <img src={Econ}/>
  }


